import axios from 'axios';
export const POST_INIT_RECIPES = 'POST_INIT_RECIPES';

//aca armo la ruta

export function postInitRecipes () {
    return function(dispatch) {
      return axios.post('http://localhost:3001/')
        .then(json => {
          dispatch({ 
            type: POST_INIT_RECIPES, 
            payload: json.data,
        });
        });
    };
  };
